import React, { useState} from 'react';
import s from './MaxValue.module.css'






export const CounterMaxValue = () => {

    const [counter,SetCounter]=useState(0)




    const onclickInc = () => {

        SetCounter(counter+1)

    }

    const  Reset =()=> {
        SetCounter(0)
    }

    const [set,Setset]=useState(false)


    const Set =()=> {
        Setset(!set)
        console.log(set)
    }




    return (
        <div className={s.fon}>
            <div className={s.around_wrapper}>
                <div className={s.around}>
                    <div> Max Value
                        <input/>

                    </div>
                    <div>
                        Min Value
                        <input/>

                    </div>
             <button onClick={Set}>set</button>
                </div>



            </div>

        </div>
    );
};
